Model-Engine:
  Print-Script-Warnings: false
  Use-State-Machine: false
  Engine-Threads: 4
  Max-Engine-Threads: 10
  Sync-Client-Tick-End: true
  Load-On-World-Load: false
  Unload-On-World-Unload: false
  Manual-Translucency-Order: false
  Default-Animation-Priority: 0
  Client-Sync-Interval: 60000
  Lower-Scale-Limit: 0.001
  Force-Custom-Model-Data: false
  Process-Empty-Timeline: false
  Render-Fire-On-Model: true
  MineSkin-API-Key: ''
  User-Limb:
    Eager-Generate-Skins: true
    Default-Classic-Skin: Steve
    Default-Slim-Skin: Alex
    Default-Skins:
      Steve:
        base64: 
      Alex:
        base64: 
        slim: true
  Default-Animations:
    IDLE: idle
    WALK: walk
    STRAFE: strafe
    JUMP_START: jump_start
    JUMP: jump
    JUMP_END: jump_end
    HOVER: hover
    FLY: fly
    SPAWN: spawn
    DEATH: death
Model-Generator:
  Delete-Old: true
  Register-Post-Server: true
  Assets-Post-Server: true
  Compile-Post-Server: true
  Enable-Error: true
  Debug-Level: 1
  Namespace: modelengine
  Create-Zip: false
  Create-Atlas: true
  Create-Shader: true
  Create-MC-META: true
  Item-Model: LEATHER_HORSE_ARMOR
  Item-Models: []
  Max-Generator-Threads: 10
Network-Optimization:
  Bundle-Everything: false
  Bundle-Size: 512
  Override-Move-To-Method: true
  Cull-Interval: 4
  Culling-Threads: 4
  Max-Culling-Threads: 10
  Vertical-Render-Distance:
    Enabled: true
    Vertical-Render-Distance: 32
    Cull-Type: CULLED
  Skip-Models-Behind-Viewer:
    Enabled: true
    View-Angle: 180
    Force-Render-Radius: 5
    Cull-Type: MOVEMENT_ONLY
  Skip-Blocked-Models:
    Enabled: true
    Force-Render-Radius: 5
    Cull-Type: CULLED
    Use-Paper-Clip-Method: false
    Force-Render-Size:
      Width: 32
      Height: 32
  Reduce-Update-When-Far:
    Enabled: true
    Active-By-Default: true
    Falloff-Length: 8
    Falloff-Multiplier: 0.85
    Full-Update-Distance: 16
    Full-Update-Distance-Multiplier-By-Size: 1
    Max-Rate-Multiplier: 1
    Min-Rate-Multiplier: 0.05
